        unsigned int  ulppll_bypass  : 1;  /* bit[1]    : ULPPLL Bypass控制，动态切换会有毛刺。
                                                          0：关闭bypass通路，输出postdiv后的时钟；
                                                          1：打开bypass通路，直接输出参考时钟【默认】。 */
        unsigned int  reserved_0     : 2;  /* bit[2-3]  :  */
